import styled from "@emotion/styled";

export const Interface = styled.div`
  padding: 6rem;
  direction:rtl;
`;

export const Wrapper = styled.div`
  width: 18rem;
  direction : rtl;
  @media (max-width: 768px) {
    width: 100%;
  }
`;
